@jimmumper Hello Jim
Contact us on messenger and we will assist you with your refund request.
Kind regards /Anna

@jawst97 Hi 
Your voucher is extended just in case you want to use it. You can request refund in money via https://t.co/ui2Ls6yWKm check voucher balance and the alternative to request refund shows.
Kind regards /Anna

@weazilthecat Hi Caroline
If you have questions regarding a voucher please contact us on messenger or live chat https://t.co/b3QIqPk7bj
Kind regards/Anna

@oliviayyli Hi Olivia 
You can contact us via Face Book messenger or live chat https://t.co/b3QIqPk7bj and we can help you further.
Kind regards /Anna

@BrommaSwinger Hej
När ett flyg är inställt så brukar nytt flyg informeras om via SMS eller E-mail , jag hoppas att det löste sig.

Med vänliga hälsningar /Anna

@ElekktraHeart Hi elekktra
Please contact us on messenger or live chat https://t.co/b3QIqPk7bj with your booking information and we will look at this.
Kind regards /Anna

@oliviayyli Hi Olivia 
Contact us on messenger and we can look at your refund.
Kind regards/Anna

@amcjrdeg Hello Jon
I'm sorry to hear that. We don't require any test to travel but we have to follow the rules set by the countries you are traveling to. We always recommend to check entry requirements before departure.
Kind regards /Anna

@ChordarMya Hi Mya
We can not book tickets via twitter but call us https://t.co/b3QIqPk7bj or book online and contact us via chat /messenger because we can request dog in cargo, do this within 24 hours from you book your ticket.
Kind regards /Anna

@Elena45747628 Hi Elena
We follow the rules set by the country you are traveling to and have transfer in , you can find them via entry requirements https://t.co/YhT9mVc7De if you are unsure we recommend you to contact the authority's for the country. 
Kind regards/Anna

@jimmumper Hi Jim
When a flight is changed you should receive a notification by SMS or e-mail  , contact us on messenger / live chat with your booking and we can check , if you want to rebook you need to call us. https://t.co/b3QIqPk7bj
Kind regards /Anna

@P4faarlund Hej
Det har varit otroliga volymer på telefon sista tiden och vi jobbar så snabbt vi kan med att ta samtalen, kötiden har blivit lite bättre nu. Som jag skrev tidigare så hoppas jag att ni har fått hjälp nu. Annars kan ni ringa +47 2189 6400 
Hälsningar /Anna

@P4faarlund Hej Bjørn
Hoppas att ni har fått hjälp med detta, annars började det bli lite bättre väntetid på telefon igår så är det inte löst kan ni ringa oss på +47 2189 6400

Hälsningar /Anna

@CharllGFXBackup Hello,
If you want to pay a rebooking fee or any difference in price with a voucher, you are welcome to call us and we will help you implement this. You can find our contact information here: https://t.co/b3QIqPk7bj

Kind regards, Anja

@RachelWlkr Hi Rachel, You have contact information at the following link under "Customer Service/Eurobonus" or you can write to us at Facebook Messenger and we will help you further in your errand,
https://t.co/b3QIqPk7bj

Kind regards, Isak

@vaibhavkumar Hello Vaibhav
You can contact us on messenger and we will answer you the same day or the day after if it is not urgent.
Kind regards /Anna

@Daneeta Hi Daneeta
If the ticket is booked directly via SAS call us to rebook https://t.co/b3QIqPk7bj if the ticket is bought via travel agency they need to contact their agent help desk if they need help to rebook.
Kind regards /Anna

@e_extremena Hi Emigrante 
When you rebook your booking via my bookings https://t.co/saQXo2wpQa you choose to pay with voucher in payment step. Or you can call us to rebook https://t.co/b3QIqPk7bj
Kind regards /Anna

@Brent_Meister Hej Jack L.A
Vi följer de regler som landet man reser till och har transfer i satt , vi har inget eget krav om test. Entry restrictions kan du finna via denna länk https://t.co/YhT9mVc7De
Hälsningar /Anna

@MigSvend Hej Svend Erik 
Nu vet jag inte hur du har kansellerat men det står innan man bekräftar kanselleringen online vad som gäller i återbetalning. Kontakta oss gärna på messenger innan du kansellerar nästa gång så kan vi förklara vad som gäller om du är osäker.
Hälsningar /Anna

@AgentHoward Hello
Contact us on messenger or live chat and we can help you with your request.
Kind regards/Anna

@peaasrum Hello 
We can not call you from twitter but wait in line and we will help you on phone when you get through https://t.co/b3QIqPk7bj
Kind regards /Anna

@peaasrum Hello Pål Einar
We answer all calls left in queue after closing hours before we go home.
Kind regards /Anna

@stavangerite Hello
At the moment we have very long waiting time on phone , approx. 2 hours. Just wait in line and we will help you when we take the call.
Best regards/Anna

@Fondacey Hello
Our lounge is not open , you can see if Star alliance lounge is open but you can bring 1 guest according to their rules as goldmember.

Best regards /Anna

@robin_daniels Hello Robin
We follow the entry requirements set by the country , you can find them here https://t.co/YhT9mVc7De 

Best regards/Anna

@elleshead Hi Ellen
The waiting time is longer than usual right now , to rebook you need to call us https://t.co/b3QIqPk7bj  if you want to request refund via can help via live chat or messenger.
Best regards /Anna

@rriiicccoo Hi Sana
Please contact us on messenger with your booking reference and we will help you regarding your refund.
Best regards/Anna

@Fondacey Hello,  
You can find information regarding access to Star Alliance lounges via this link:  https://t.co/gJ9nCJIWZs

Kind regards, Anja

@Fondacey Hello, 
Yes, the EWR lounge is currently closed. We do not yet have an estimated date when the lounge will reopen.

Kind regards, Anja

@lukhrsh Hello,
Yes, this flight is scheduled to depart at 2:15 p.m (14:15) 27.08.2021. 

Kind Redards, Anja

@chris_mcpolin Hello,
I would like to ask you to contact customer service and we will take a closer look at the rules that apply to your voucher. You can contact us via messenger or via  the contact information on this page: https://t.co/b3QIqPk7bj
Kind regards, Anja

@AgentHoward Hello, 
At the moment, there are many customers who want to contact us, which leads to increased queues, I apologize for this. I recommend calling in the morning for reduced queue time.

Kind regards, Anja

@kristinborresen Hello
If only a small typo is wrong, you can contact us via our live chat and we will help you. If several letters are incorrect, I would like to ask you to call us and we will help you correct this. You can find our contacts here: https://t.co/b3QIqPk7bj

Regards Anja

@freitagspolitik Hello, 
If you booked your trip through SAS your ticket is refundable within 24 hours of purchase, regardless of ticket type. In the case of an open purchase, the full value of the ticket is refunded.

Kind regards, Anja

@e_extremena Hello, 
Your SAS travel voucher can be used to book a new flight to any of our destinations or to buy travel extras. 

Kind regards, Anja

@DrmPharmD We apologize again, please use the link we sent earlier if you wish to send a complaint to us regarding this, we are not able to help with this through social media.

Best regards,
Anton.

@FlemmingBig Hello! You can bring your drone in the carry-on as long as it does not exceed max weight/dimensions for carry-on and batteries does not exceed an effect of 160Wh. If the batteries can be taken out they should be individually packed to prevent short circuits.

//
Anton.

@DrmPharmD Hello. You can read more information about what masks are allowed and not on our flights at https://t.co/E6bpHzaWLm - if you wish to leave complaints about our mask policy, please use our feedback form https://t.co/wprQ9Zejqh

Best regards,
Anton.

@lenalindstrom12 Hello! Thank you for the info. To report bugs in the app please go to the menu on the top left in the app and then click on "App feedback". If you were not able to download the boarding card you can retrieve it on the airport instead.

Best regards,
Anton.

@MortenBergheim Hej, 
Jag vill be dig att ta kontakt med oss via telefon eller vår livechatt så att vi kan kika på vad som gäller för dig, vi har nämnligen olika typer av vouchers med olika regler. Du hittar våra kontaktuppgifter här: https://t.co/cIkJt9kPnF

Hälsningar, Anja

@MortenBergheim Hej, 
En SAS travel voucher kan användas för att boka en ny flygning till någon av våra destinationer eller för att köpa extratillägg. Du kan boka resor med avresa efter voucherns giltighetstid så länge du bokar resan innan voucherns utgångsdatum. 

Hälsningar, Anja

@EvaBremer Hello! Please contact us on Facebook Messenger or the live-chat https://t.co/b3QIqPk7bj so we can help you take a look at if the voucher is refundable or not.

Best regards,
Anton.

@Filosophation Hello, we have responded to your other comment here on Twitter.

Best regards,
Anton.

@Filosophation Hello! I am sorry to hear that you are still missing your refund, please contact us through the Facebook Messenger or live-chat https://t.co/b3QIqPk7bj so we can help you take a look at the refund case.

Best regards,
Anton.

@neslekkim Hej. Landet du reser till kanske har krav på att testet får vara max 24 timmar gammalt vid avresa men andra länder kan ha krav på 48 eller 72 timmar och därför öppnar Travel Ready Center 72 timmar före avresa.

Med vänlig hälsning,
Anton.

@davidpoblador Hello! The email address for our claim department Customer Care can be found on the bottom of this page https://t.co/wprQ9Zejqh - this email is however not used for responding to customers regarding claims.

Best regards,
Anton.

@_Matthew_Shaw Please contact our phone support so they can help you take a look at this. We are unfortunately not able to assist with specific cases here through social media.

Best regards,
Anton.

@_Matthew_Shaw Hello. I am sorry to hear that your flight was rescheduled and with additional stops. Please contact our phone support for help with rebooking to new alternatives. Our phone numbers can be found at https://t.co/b3QIqPk7bj

Best regards,
Anton.

@bdgti Hello! Please contact us through Messenger or Live-chat https://t.co/b3QIqPk7bj with your voucher details so we can help you take a look at this.

Best regards,
Anton.

@sisy72796214 Hello, 
Please contact SAS customer service and we will take a look at what applies to their booking. You can find our contact information here: https://t.co/b3QIqPk7bj

Best regards, Anja

@minamello Hello, 
SAS is offering rebooking free of charge and to cancel their booking and receive a voucher for all International flights until 72 hours before departure. Within 72 hours from departure ordinary ticket rules applies.

Best regards, Anja

@MchlBrk Hello
Ok i understand. I would advice you to make a new case and refer to your old case id 7 numbers. You can make a new case via https://t.co/cE0TvFYaMV

Best regards /Anna

@dano8217 Hello
The boarding process will go faster with only one luggage to screen and check through security.

Best regards/Anna

@fatihbayram82 Hello
Unfortunately there is a longer queue on phone right now and we are working as hard as we can, we answer all calls in queue before we go home so stay on the line.
Kind regards/Anna
